core::f64::<impl f64>::abs.doc:
Computes the absolute value of `self`.

This function always returns the precise result.

# Examples

```
let x = 3.5_f64;
let y = -3.5_f64;

assert_eq!(x.abs(), x);
assert_eq!(y.abs(), -y);

assert!(f64::NAN.abs().is_nan());
```

f64::<impl f64>::ln_1p.doc:
Returns `ln(1+n)` (natural logarithm) more accurately than if
the operations were performed separately.

This returns NaN when `n < -1.0`, and negative infinity when `n == -1.0`.

# Unspecified precision

The precision of this function is non-deterministic. This means it varies by platform, Rust version, and
can even differ within the same execution from one invocation to the next.
This function currently corresponds to the `log1p` from libc on Unix
and Windows. Note that this might change in the future.

# Examples

```
let x = 1e-16_f64;

// for very small x, ln(1 + x) is approximately x - x^2 / 2
let approx = x - x * x / 2.0;
let abs_difference = (x.ln_1p() - approx).abs();

assert!(abs_difference < 1e-20);
```

Out-of-range values:
```
assert_eq!((-1.0_f64).ln_1p(), f64::NEG_INFINITY);
assert!((-2.0_f64).ln_1p().is_nan());
```

core::f64::<impl f64>::copysign.doc:
Returns a number composed of the magnitude of `self` and the sign of
`sign`.

Equal to `self` if the sign of `self` and `sign` are the same, otherwise equal to `-self`.
If `self` is a NaN, then a NaN with the same payload as `self` and the sign bit of `sign` is
returned.

If `sign` is a NaN, then this operation will still carry over its sign into the result. Note
that IEEE 754 doesn't assign any meaning to the sign bit in case of a NaN, and as Rust
doesn't guarantee that the bit pattern of NaNs are conserved over arithmetic operations, the
result of `copysign` with `sign` being a NaN might produce an unexpected or non-portable
result. See the [specification of NaN bit patterns](primitive@f32#nan-bit-patterns) for more
info.

# Examples

```
let f = 3.5_f64;

assert_eq!(f.copysign(0.42), 3.5_f64);
assert_eq!(f.copysign(-0.42), -3.5_f64);
assert_eq!((-f).copysign(0.42), 3.5_f64);
assert_eq!((-f).copysign(-0.42), -3.5_f64);

assert!(f64::NAN.copysign(1.0).is_nan());
```

